import './Info.css';
import Person from './pexels-daniel-xavier-1239291.jpg';

class Info extends Component {
    render() {
        return (
            <div className={'container'}>
                <div className={'info-main'}>
                    <div className={'left'}>
                        <div className={'top'}>
                            <img src={Person}/>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default Info;
